import { signInWithEmailAndPassword } from "firebase/auth";
import React,{useState} from "react";
import { auth } from "../firebase/firebase-config";

function LoginForm(props) {
    const [loginEmail,setLoginEmail]=useState("")
    const [loginPass,setLoginPass]=useState("")
    const signin=async ()=>{

        try{
            const user=await signInWithEmailAndPassword(auth,loginEmail,loginPass)
            console.log(user)
          }
          catch(error){
            console.log(error.message)
          }
          }

    return (
        <form action="" onClick={(e)=>{
            e.preventDefault()

        }}>
            <div className="form">

                <h4>
                    Login
                </h4>

                <label>Your Email</label>
                <br />
                <input type="email" placeholder="enter your email" onChange={(e)=>{
                    setLoginEmail(e.target.va)
                }}/>
                <label>Your Password</label>
                <br />
                <input type="password" placeholder="enter your pass" autoComplete="on"/>
                <br /><br />
                <button onChange={signin}> Login</button>
                <br />
                <p onClick={() => {
                    props.chgForm()
                }}>Create new account</p>

            </div>
        </form>

    );
}
export default LoginForm
